import React from "react";

export default class NavPrint extends React.Component {
  //   render (){navItems.forEach((navItem) => {
  //     <NavItems name={navItem.name} index={navItem.id} />;

  //   })};

  render() {
    {
      this.props.navItems.map((navItem, index) => {
        return <li key={navItem.id}> {navItem.name}</li>;
      });
    }
  }
}
